import React, { Component } from "react";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);
    console.log("props initialised");

    const nasa = [
      {
        id: 0,
        title: "this is the title",
        description: "this is the description"
      },
      {
        id: 1,
        title: "this is the title2",
        description: "this is the description2"
      }
    ];

    var nasaRows = [];
    nasa.forEach(nasaItem => {
      console.log(nasaItem.title);
      const nasaRow = (
        <table key={nasaItem.id}>
          <tbody>
            <tr>
              <td>
                <img alt="item" src="" />
              </td>
              <td>{nasaItem.title}</td>
            </tr>
          </tbody>
        </table>
      );
      nasaRows.push(nasaRow);
    });
    this.state = { rows: nasaRows };
  }
  render() {
    return (
      <div className="App">
        <table className="titleHeader">
          <tbody>
            <tr>
              <td>
                <img
                  alt="Icon"
                  width="100"
                  src="https://api.nasa.gov/images/logo.png"
                />
              </td>
              <td width="10" />
              <td>
                <h1>NASA Images</h1>
              </td>
            </tr>
          </tbody>
        </table>
        <input
          style={{
            fontSize: 20,
            display: "block",
            width: "99%",
            paddingTop: 8,
            paddingBottom: 8,
            paddingLeft: 15
          }}
          placeholder="Type here"
        />

        {this.state.rows}
      </div>
    );
  }
}

export default App;
